import React from "react";
import Card from "./Card";
 const Cards =({courses})=>
 {
    let allCourses=[];
    const getCourses=()=>{
        Object.values(courses).forEach((courseCategory)=>
        {
            courseCategory.forEach((courses)=>
                {
                    allCourses.push(courses);

                })
        })
        return allCourses;

    }
    return (
        <div>
         {/* getCourses().map((course)=>{
            <Card/>

         }) */}
         getCourses().map((course))
        </div>
    );
 }
 export default Cards;
